import React, { Component } from "react";
import "./home.css"
import "tachyons"
import Navbar from "./components/navbar"

class Home extends Component {
  render() {
    return (
      <div className="tc">
        <div className="grow">
          <img src="./images/profile.png" />
        </div>
        <h1 className="white lh-title f1">Naman Ranawat</h1>
        <Navbar className="center" />
      </div>

    );
  }
}

